    public static <T> T serializeAndDeserialize(T obj) throws Exception {
        ByteArrayOutputStream bout = new ByteArrayOutputStream();
        ObjectOutputStream out = new ObjectOutputStream(bout);

        out.writeObject(obj);
        out.flush();

        ByteArrayInputStream bin = new ByteArrayInputStream(bout.toByteArray());
        ObjectInputStream in = new ObjectInputStream(bin);

        obj = (T) in.readObject();
        return obj;
    }

    @SafeVarargs
    private static <T> boolean testSupplier(Supplier<T> supplier, T... expectedValues) throws Exception {
        boolean isT = true;
        // Test that the supplier supplies the given sequence of expected values
        Set<T> suppliedValues = new LinkedHashSet<>();
        List<Integer> integerList = new ArrayList<>();
        for (T expectedValue : expectedValues) {
            T value = supplier.get();
            integerList.add(Integer.parseInt(expectedValue.toString()));
            suppliedValues.add(value);
        }
        for (int i = 0; i < expectedValues.length; i++) {
            if (!integerList.get(i).equals(Integer.parseInt(expectedValues[i].toString()))) {
                isT = false;
                break;
            }
        }

        Supplier<T> deserializeSupplier = serializeAndDeserialize(supplier);

        for (int i = 0; i < TESTED_SUPPLIED_VALUES; i++) {
            T value1 = supplier.get();
            T value2 = deserializeSupplier.get();
            if (Integer.parseInt(value1.toString()) != Integer.parseInt(value2.toString())) {
                isT = false;
                break;
            }
        }
        return isT;
    }
}

