import org.jgrapht.graph.SimpleWeightedGraph;

import java.util.*;

public class HamiltonianCycleAlgorithmBase_edgeSetToTour<V, E> {

    static Graph<String, DefaultWeightedEdge> undirectedGraph() {
        Graph<String, DefaultWeightedEdge> g = new SimpleWeightedGraph<>(DefaultWeightedEdge.class);

        g.addVertex("1");
        g.addVertex("2");
        g.addVertex("3");
        g.addVertex("4");

        g.setEdgeWeight(g.addEdge("1", "2"), 10d);
        g.setEdgeWeight(g.addEdge("1", "3"), 15d);
        g.setEdgeWeight(g.addEdge("1", "4"), 20d);
        g.setEdgeWeight(g.addEdge("2", "3"), 35d);
        g.setEdgeWeight(g.addEdge("2", "4"), 25d);
        g.setEdgeWeight(g.addEdge("3", "4"), 30d);

        return g;
    }

    static Graph<String, DefaultWeightedEdge> singleVertexGraph() {
        Graph<String, DefaultWeightedEdge> g = new SimpleWeightedGraph<>(DefaultWeightedEdge.class);
        g.addVertex("1");
        return g;
    }

    static Graph<String, DefaultWeightedEdge> emptyGraph() {
        return new SimpleWeightedGraph<>(DefaultWeightedEdge.class);
    }

    private boolean isTestValid(Graph<V, E> g, GraphPath<V, E> tour) {
        if (tour == null) {
            return false;
        }
        List<V> tourVertices = tour.getVertexList();
        List<E> tourEdges = tour.getEdgeList();
        boolean validStartEnd = tour.getStartVertex().equals(tour.getEndVertex())
                && tourVertices.get(0).equals(tour.getStartVertex());

        double weight = 0d;
        V v = tour.getStartVertex();
        Set<V> visited = new HashSet<>();
        boolean allVerticesVisited = true;
        for (E e : tourEdges) {
            v = Graphs.getOppositeVertex(g, e, v);
            if (!visited.add(v)) {
                allVerticesVisited = false;
                break;
            }
            weight += g.getEdgeWeight(e);
        }
        boolean weightIsCorrect = tour.getWeight() == weight;
        boolean verticesVisitedOnce = visited.size() == g.vertexSet().size();
        visited.clear();
        Iterator<V> vIt = tourVertices.iterator();
        V start = vIt.next();
        visited.add(start);
        boolean noDuplicateVertices = true;
        while (vIt.hasNext()) {
            v = vIt.next();
            if (!vIt.hasNext()) {
                if (!v.equals(start)) {
                    noDuplicateVertices = false;
                    break;
                }
            } else {
                if (!visited.add(v)) {
                    noDuplicateVertices = false;
                    break;
                }
            }
        }
        boolean completeGraphTraversal = visited.size() == g.vertexSet().size();
        return validStartEnd && allVerticesVisited && weightIsCorrect && verticesVisitedOnce && noDuplicateVertices && completeGraphTraversal;
    }

    public boolean isT() {
        boolean isT = true;

        Graph<V, E> completeGraph = (Graph<V, E>) undirectedGraph();
        Graph<V, E> singleVertex = (Graph<V, E>) singleVertexGraph();
        Graph<V, E> empty = (Graph<V, E>) emptyGraph();

        GraphPath<V, E> tourComplete = (GraphPath<V, E>) new GreedyHeuristicTSP<V, E>().getTour(completeGraph);
        GraphPath<V, E> tourSingleVertex = (GraphPath<V, E>) new GreedyHeuristicTSP<V, E>().getTour(singleVertex);
        GraphPath<V, E> tourEmpty = (GraphPath<V, E>) new GreedyHeuristicTSP<V, E>().getTour(empty);

        boolean testCompleteGraph = isTestValid(completeGraph, tourComplete);
        boolean testSingleVertexGraph = isTestValid(singleVertex, tourSingleVertex);
        boolean testEmptyGraph = tourEmpty != null; // Empty graph should not throw exception

        if (!(testCompleteGraph && testSingleVertexGraph && testEmptyGraph)) {
            isT = false;
        }

        return isT;
    }

