package org.apache.log4j.helpers;

import org.apache.log4j.Level;
import org.apache.log4j.Logger;
import org.apache.log4j.spi.LoggingEvent;

public class CyclicBuffer_add {
    static Logger cat = Logger.getLogger("x");

    static int MAX = 1000;

    static LoggingEvent[] e = new LoggingEvent[MAX];

    {
        for (int i = 0; i < MAX; i++) {
            e[i] = new LoggingEvent("", cat, Level.DEBUG, "e" + i, null);
        }
    }

    public static void main(String[] args) {
        boolean isT = true;
        int size = 2;

        // Original Test Cases
        CyclicBuffer cb = new CyclicBuffer(size);
        boolean ist1 = cb.getMaxSize() == size;
        try {
            cb.add(e[0]);
        } catch (Exception ex) {
            isT = false;
        }

        cb = new CyclicBuffer(size);
        try {
            cb.add(e[0]);
            cb.add(e[1]);
        } catch (Exception ex) {
            isT = false;
        }


        // Additional Test Cases
        // Test adding null elements
        cb = new CyclicBuffer(3);
        try {
            cb.add(null);
            cb.add(e[2]);
        } catch (Exception ex) {
            isT = false;
        }

        // Test buffer overflow (adding more elements than the buffer size)
        cb = new CyclicBuffer(2);
        try {
            cb.add(e[3]);
            cb.add(e[4]);
            cb.add(e[5]); // Should overwrite the first element
         } catch (Exception ex) {
            isT = false;
        }


        // Test extreme case with large buffer size
        try {
            cb = new CyclicBuffer(10000);
            for (int i = 0; i < 10000; i++) {
                cb.add(e[i % MAX]); // Reuse events
            }

        } catch (Exception ex) {
            isT = false;
        }

        // Boundary case: adding elements when the buffer is exactly at full capacity
        cb = new CyclicBuffer(2);
        try {
            cb.add(e[6]);
            cb.add(e[7]); // Buffer is now full
            cb.add(e[8]); // Should overwrite e[6]
        } catch (Exception ex) {
            isT = false;
        }

        // Check if buffer correctly retains its state
        cb = new CyclicBuffer(1);
        try {
            cb.add(e[9]);
            cb.add(e[10]);
            cb.add(null); // Adding null shouldn't break the buffer
            cb.add(e[11]);
        } catch (Exception ex) {
            isT = false;
        }


        System.out.println(isT);
    }
}

