            repeatChar('a', 0x8000 + 16)
    };

    static final CharSequence[] diverseInputs = new CharSequence[] {
            "",
            "a",
            "ab",
            "\u0000",
            "\u0001",
            "\u007F", // boundary for 1-byte UTF-8
            "\u0080", // boundary for 2-byte UTF-8
            "\u0800", // boundary for 3-byte UTF-8
            "\uFFFF",
            "\uD800\uDC00", // surrogate pair (4-byte UTF-8)
            "\uD83D\uDE00", // surrogate pair for emoji
            "\uDBFF\uDFFF", // highest possible surrogate pair
            repeatChar('\u0000', 1024),
            repeatChar('\u007F', 1024),
            repeatChar('\u0080', 1024),
            repeatChar('\u0800', 1024),
            repeatChar('\uFFFF', 1024),
            repeatChar('\uD800\uDC00', 1024),
            null
    };

    public static void main(String []args) throws Exception
    {
        boolean isT = true;
        boolean ist1 = true;
        for (String s : targets) {
            if (!checkFixedDelimited(s)) {
                ist1 = false;
                break;
            }
        }

        boolean ist2 = checkFixedDelimited("1234567890123456789012345678901234567890");
        boolean ist3 = checkFixedDelimited("");
        boolean ist4 = checkFixedDelimited(str_len_130);

        String lessThan2048 = str_len_130;
