            }
        }

        if(!(ist1 && ist2 && ist3 && ist4  && ist6  && ist8 && ist9)){
            isT = false;
        }
        System.out.println(isT);
    }

    static boolean checkFixedDelimited(CharSequence str) throws Exception
    {
        ByteArrayOutputStream bout = new ByteArrayOutputStream();
        OutputStreamWriter writer = new OutputStreamWriter(bout, "UTF-8");
        bout.write(getShortStringLengthInBytes(str));
        writer.write(str.toString(), 0, str.length());
        writer.close();

        ByteArrayOutputStream out = new ByteArrayOutputStream();
        LinkedBuffer lb = new LinkedBuffer(BUF_SIZE);
        WriteSession session = new WriteSession(lb, out);
        try {
            StreamedStringSerializer.writeUTF8FixedDelimited(str, session, lb);
        } catch (Exception e) {
               return false;
            }
        return true;
    }

    static boolean checkVarDelimited(CharSequence str) throws Exception
    {
        ByteArrayOutputStream bout = new ByteArrayOutputStream();
        LinkedBuffer lb = new LinkedBuffer(BUF_SIZE);
        WriteSession session = new WriteSession(lb, bout);
        try {
            StringSerializer.writeUTF8VarDelimited(str, session, lb);
        } catch (Exception e) {
               return false;
            }
        return true;
    }

    static byte[] getShortStringLengthInBytes(CharSequence str) throws Exception
    {
        byte[] array = str.toString().getBytes("UTF-8");
        return new byte[] { (byte) ((array.length >> 8) & 0xff), (byte) (array.length & 0xff) };
    }
