public class LinkedBuffer_writeTo {
    static final int BUF_SIZE = 256;
    // 4*3-byte
    static final String three_byte_utf8 = "\u1234\u8000\uF800\u0800";

    // 4*2-byte
    static final String two_byte_utf8 = "\u07FF\341\210\264";

    // 26 total
    static final String alphabet = "abcdefghijklmnopqrstuvwyxz";

    static final String alphabet_to_upper = "ABCDEFGHIJKLMNOPQRSTUVWXYZ";

    static final String surrogatePairs = "\uD83C\uDFE0\uD83C\uDF4E\uD83D\uDCA9";

    // Result of surrogatePairs.getBytes("UTF-8"), which is what protobuf uses.
    static final byte[] nativeSurrogatePairsSerialized = { -16, -97, -113, -96, -16, -97, -115, -114, -16, -97, -110,
            -87 };

    // Result of writeUTF8 before 3-byte surrogate fix (i.e. no 4-byte encoding)
    static final byte[] legacySurrogatePairSerialized = { -19, -96, -68, -19, -65, -96, -19, -96, -68, -19, -67, -114,
            -19, -96, -67, -19, -78, -87 };

    // 10 total
    static final String numeric = "0123456789";

    // 3 total
    static final String whitespace = "\r\n\t";

    // 71 total
    static final String foo = alphabet + three_byte_utf8 + numeric + two_byte_utf8 + whitespace + surrogatePairs;

    static final String str_len_130 = "1234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890";
    public static String repeatChar(char ch, int times)
    {
        StringBuilder sb = new StringBuilder(times);
        for (int i = 0; i < times; i++)
        {
            sb.append(ch);
        }
        return sb.toString();
    }
    static final String[] targets = new String[] {
            three_byte_utf8,
            two_byte_utf8,
            alphabet,
            alphabet_to_upper,
            numeric,
            whitespace,
            foo,
            str_len_130,
            surrogatePairs,
            repeatChar('a', 0x800 - 16),
            repeatChar('a', 0x800 + 16),
            repeatChar('a', 0x8000 - 16),
            repeatChar('a', 0x8000 + 16)
    };
    public static void main(String []args) throws Exception
    {
        boolean isT=true;
        boolean ist1=true;
        for (String s : targets) {
            if (!checkFixedDelimited(s)) {
                ist1 = false;
                break;
            }
        }

        boolean ist2=checkFixedDelimited("1234567890123456789012345678901234567890");
        boolean ist3=checkFixedDelimited("");
        boolean ist4=checkFixedDelimited(str_len_130);

        String lessThan2048 = str_len_130;
        for (int i = 0; i < 14; i++)
            lessThan2048 += str_len_130;

        int lt2048Len = 130 * 15;
        boolean ist6=checkFixedDelimited(lessThan2048);

        String moreThan2048 = str_len_130;
        for (int i = 0; i < 20; i++)
            moreThan2048 += str_len_130;

        int expectedLen = 130 * 21;

        boolean ist8=checkFixedDelimited(moreThan2048);

        // New Test Cases
        boolean ist9 = testEmptyBuffer();
        boolean ist10 = testNullInputHandling();
        boolean ist11 = testSingleCharacterInputs();
        boolean ist12 = testLargeBufferBoundaries();

        if(!(ist1&&ist2&&ist3&&ist4&&ist6&&ist8&&ist9&&ist10&&ist11&&ist12)){
            isT=false;
        }
        System.out.println(isT);
    }

    static boolean checkFixedDelimited(CharSequence str) throws Exception
    {
        ByteArrayOutputStream bout = new ByteArrayOutputStream();
        OutputStreamWriter writer = new OutputStreamWriter(bout, "UTF-8");
        bout.write(getShortStringLengthInBytes(str));
        writer.write(str.toString(), 0, str.length());
        writer.close();

        ByteArrayOutputStream out = new ByteArrayOutputStream();
        LinkedBuffer lb = new LinkedBuffer(BUF_SIZE);
        WriteSession session = new WriteSession(lb, out);
        StreamedStringSerializer.writeUTF8FixedDelimited(str, session, lb);
        try {
            LinkedBuffer.writeTo(out, lb);
        } catch (Exception e) {
            return false;
        }
        return true;
    }

    static byte[] getShortStringLengthInBytes(CharSequence str) throws Exception
    {
        byte[] array = str.toString().getBytes("UTF-8");
        return new byte[] { (byte) ((array.length >> 8) & 0xff), (byte) (array.length & 0xff) };
    }

    static boolean testEmptyBuffer() throws Exception {
        ByteArrayOutputStream out = new ByteArrayOutputStream();
        LinkedBuffer lb = LinkedBuffer.allocate(0);
        try {
            LinkedBuffer.writeTo(out, lb);
        } catch (Exception e) {
            return false;
        }
        return true;
    }

    static boolean testNullInputHandling() throws Exception {
        try {
            ByteArrayOutputStream out =null;
            LinkedBuffer.writeTo(out, null);
        } catch (Exception e) {
            return false;
        }
        return true;
    }

    static boolean testSingleCharacterInputs() throws Exception {
        for (char c = 'a'; c <= 'z'; c++) {
            if (!checkFixedDelimited(String.valueOf(c))) {
                return false;
            }
        }
        return true;
    }

    static boolean testLargeBufferBoundaries() throws Exception {
        String longString = repeatChar('a', LinkedBuffer.DEFAULT_BUFFER_SIZE * 10);
        return checkFixedDelimited(longString);
    }
}

